import React, {useEffect, useState} from 'react';
// import axios from "axios";
// import './App.css';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Header from './components/Header.js';
import Homes from './components/Homes.js';
import Makeup from './components/Makeup.js';
import Mens from './components/Mens.js';
import Womens from './components/Womens.js';
import Footer from './components/Footer.js';
// import { render } from '@testing-library/react';

class App extends React.Component() {
  constructor (props){
    super(props);
      this.useState={};
    }

    render (){
  return (
    <div>
      <Header/>
    <Router>
      <div>
        <ul className = "NavBar">
          <li>
            <Link to="/homes">Home Inventory</Link>
          </li>
          <li>
            <Link to="/makeups">Makeup Inventory</Link>
          </li>
          <li>
            <Link to="/mens">Mens Inventory</Link>
          </li>
          <li>
            <Link to="/womens">Womens Inventory</Link>
          </li>
         </ul>
        <Switch>
          <Route path="/homes">
            <Homes />
          </Route>
          <Route path="/makeups">
            <Makeup/>
          </Route>
          <Route path="/mens">
            <Mens/>
          </Route>
          <Route path="/womens">
            <Womens />
          </Route>
         </Switch>
         </div>
       </Router>
      <Footer />
    </div>
  );
}
}

export default App;
